import React from 'react';


class Footer extends React.Component {


	test(){
		let productList = [];
		for(let i =0 ;i<=4;i++){	
			productList.push(<div>Test</div>);
		}
		return productList;
	}

	render(){
		let productList = this.test();
		return(
			<div>{productList}</div>
		)
	}
}


export default Footer;
